import jwt_decode from "jwt-decode";
import { useEffect } from "react";

export default function Login() {
    const gmailClientId = "412920764604-j8act2t26db6ci1jq74bdj3fd7ju64bd.apps.googleusercontent.com";

    const handleCallbackResponse = (response) => {
        console.log("jwt decode: "+ response.credential);
        var userObj = jwt_decode(response.credential);
        console.log(userObj);
    }

    useEffect(()=>{
        /* Google */
        google.accounts.id.initialize({
            client_id: '412920764604-j8act2t26db6ci1jq74bdj3fd7ju64bd.apps.googleusercontent.com',
            callback: handleCallbackResponse
        })
    }, [])


    return (
        <>
            <div>
                <p>Login Page</p>

            </div>
            <section>
                {/* Generate the intregration code */}
                <div id="g_id_onload"
                    data-client_id={gmailClientId}
                    data-context="signin"
                    data-callback="GLogin"
                    data-itp_support="true">
                </div>
            </section>

        </>
    );
}
